import './App.css'
import { ImageCard } from "./code assects/imageCard";

function App() {
  return (
    <div className="page">
      <div className="content-obj">
      <ImageCard 
            cardTitle={'Potato leaf'} 
            plantName={'Potato'}
            diseaseName={'Early Blight'}
            confidence={'98.2'}
            imgLink={'/assects/images/00.jpg'}
      />  
    </div>
    </div>
  );
}

export default App;
